import React from 'react'

export const Cashout = () => {
  return (
    <div>CashoutAnh ơi! Mới đó mà anh đã rời xa em…Anh đã giải thoát bụi trần mà để lại con cháu, anh em nổi buồn không nguôi trên trần gian biến động…Thôi, Vĩnh biệt anh!…Nhan Dang Thanh, Tri Huu Nguyen, Hiền Lê, Đặng Đại Dinh cố lên các cháu yêu…</div>
  )
}
